--exec Custom_Diabetes_Get_List '2021-06-01','2021-06-08','',1,100

CREATE PROCEDURE [dbo].[Custom_Diabetes_Get_List] 
(
	@FromDate		datetime,
	@ToDate			datetime,
	@Gender			varchar(6),
	@PageIndex		int,
	@PageSize		int
)
AS
	SET NOCOUNT ON

	SELECT 	Id,
			Age, 
			Gender, 
			Polyuria, 
			Polydipsia, 
			SuddenWeightLoss, 
			Weakness, 
			Polyphagia, 
			GenitalThrush, 
			VisualBlurring, 
			Itching, 
			Irritability, 
			DelayedHealing, 
			PartialParesis, 
			MuscleStiffness, 
			Alopecia, 
			Obesity, 
			Class,
			CreatedDate,
			CreatedBy,
			ROW_NUMBER() OVER (ORDER BY CreatedDate DESC) as RowNumber,
			CONVERT(int, CEILING(CAST(COUNT(*) OVER () AS DECIMAL(10, 2))/CAST(@PageSize AS DECIMAL(10, 2)))) as TotalPages
	   FROM	   
			dbo.Diabetes
	  WHERE
			(CreatedDate BETWEEN @FromDate AND @ToDate) AND
			(LEN(@Gender)=0 OR Gender=@Gender)
   ORDER BY RowNumber ASC
			OFFSET ((@PageIndex-1) * @PageSize) ROWS 
			FETCH NEXT @PageSize ROWS ONLY;

GO
